INSERT INTO Comments VALUES(114,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-09-29T16:07:05.087');
INSERT INTO Comments VALUES(115,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;">Line numbered 41.</p>\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-09-29 15:54:44');
INSERT INTO Comments VALUES(116,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line numbered 22.</span></p></body></html>'),'2016-09-29T16:50:00.708');
INSERT INTO Comments VALUES(117,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">New loop at Chippewa.</span></p></body></html>'),'2016-09-29 16:08:55');
INSERT INTO Comments VALUES(118,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-09-29 16:10:23');
INSERT INTO Comments VALUES(119,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;">Line numbered 04.</p></body></html>'),'2016-09-29T16:11:47.834');
INSERT INTO Comments VALUES(120,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Log Cabin wye replaced by a loop.</span></p></body></html>'),'2022-10-26T13:31:11.348Z');
INSERT INTO Comments VALUES(121,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line converted to one-man operation.</span></p></body></html>'),'2016-09-29 16:17:45');
INSERT INTO Comments VALUES(122,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Eastern terminal of line cut back from DeBaliviere and Delmar to Skinker and Administration Building(Washington University) at Rock Island RR tracks (the Millbrook/Forest Park Expressway/present entrance to underground Skinker Metrolink station).</span></p></body></html>'),'2022-09-27T15:48:32.288Z');
INSERT INTO Comments VALUES(123,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line numbered 80.</span></p></body></html>'),'2016-09-29T16:23:47.867');
INSERT INTO Comments VALUES(124,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed west on Washington to 14th, then south to Pine. West on Pine, then south on 18th, this done to avoid traffic congestion.</span></p></body></html>'),'2016-09-29 16:21:57');
INSERT INTO Comments VALUES(125,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">During 1925, one-man operation on Sundays and Holidays begins.</span></p>\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt;"><br /></p></body></html>'),'2016-09-29 16:22:38');
INSERT INTO Comments VALUES(126,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed back to pre-December 1922 pattern via Washington and 18th.</span></p></body></html>'),'2016-09-29 16:23:33');
INSERT INTO Comments VALUES(127,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;">Line numbered 05</p></body></html>'),'2016-09-29T16:30:37.365');
INSERT INTO Comments VALUES(128,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Eastern terminal at Delmar and DeBaliviere cut back </span></p>\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">to the Delmar(University City) loop.</span></p></body></html>'),'2022-09-27T19:26:52.165Z');
INSERT INTO Comments VALUES(129,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line begins a new rush-hour through service from Crow''s Nest loop to Downtown (Olive/4th). However it''s possible this did not start until December 2nd. </span></p></body></html>'),'2016-09-29 16:30:21');
