INSERT INTO Comments VALUES(150,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Seventh Street line merged in with Lee.</span></p></body></html>'),'2016-09-29 16:58:14');
