INSERT INTO Comments VALUES(155,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">St Louis &amp; Suburban merged with United Railways. </span><span style=" font-size:9pt;">A covert operation undertaken by United Railways the early mornig of December 31, 1906 installed a new connection from St Louis &amp; Suburban''s track on Manchester to United Railway''s Market St line on Chouteau enabled Manchester line cars to travel to downtown via  Chouteau and Market rather than via N Sarah to the Hodiamont line.</span></p></body></html>'),'2022-10-20T18:49:58.988Z');
