INSERT INTO Comments VALUES(172,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Extended from West End Heights to Sunset Hill 0.85 miles. This formerly single track stretch of St. Louis &amp; Kirkwood was double-tracked.</span></p></body></html>'),'2016-09-29 18:13:12');
INSERT INTO Comments VALUES(173,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Track and loop in Forest Park abandoned. New Track opened on Oakland from Kingshighway to River Des Peres at a point where the just-abandoned line in Forest Park joined Oakland. Cars now run north and south on Kingshighway, east ane west on Oakland to connect the two older portions of the line. </span></p></body></html>'),'2023-10-16T20:21:01.302Z');
INSERT INTO Comments VALUES(174,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Double tracks on Oakland Avenue between r/w of the new City Limits line and Bellevue Avenue and on Belleview Avenue between Oakland and Wise Avenues abandoned and subsequently removed. The cars rerouted to the new City Limits r/w to Wise Avenue, west over double tracks in the center of Wise Aveue from City Limits r/w at Wise and Bellevue.</span></p></body></html>'),'2016-09-29 18:26:17');
