INSERT INTO Comments VALUES(184,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">Olive-McPherson </span><span style=" font-size:9pt;">service ceases.</span></p></body></html>'),'2022-10-28T19:56:15.254Z');
INSERT INTO Comments VALUES(185,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">Olive-McPherson</span><span style=" font-size:9pt;"> cars extended 1.2 miles west fron DeBaliviere loop to 6400 block loop just west of Skinker and line renamed </span><span style=" font-size:9pt; font-weight:600;">Olive-University</span><span style=" font-size:9pt;">.</span></p></body></html>'),'2022-10-26T03:58:40.341Z');
INSERT INTO Comments VALUES(186,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;">Line extended along today''s Millbrook from 6400 block loop, to meet <span style=" font-weight:600;">Kirkwood-Ferguson</span> cars at Melville and then on to new Big Bend loop. This is the alignment of the 2006 Metrolink line to Clayton and Shrewsbury. </p></body></html>'),'2022-10-26T03:41:01.982Z');
