INSERT INTO Comments VALUES(211,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed north and south on Jefferson, between Geyer and Gravois.</span></p></body></html>'),'2022-10-21T20:08:46.731Z');
INSERT INTO Comments VALUES(212,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line begins using new Tamm Avenue loop, replacing track on Columbia Avenue used as a wye. </span></p></body></html>'),'2016-09-29 19:30:31');
INSERT INTO Comments VALUES(213,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">Fourth Street</span><span style=" font-size:9pt;"> and </span><span style=" font-size:9pt; font-weight:600;">Tower Grove</span><span style=" font-size:9pt;"> lines merged to form </span><span style=" font-size:9pt; font-weight:600;">Fourth Street Belt </span><span style=" font-size:9pt;">and </span><span style=" font-size:9pt; font-weight:600;">Tower Grove Belt </span><span style=" font-size:9pt;">lines. Tower Grove Belt line is reverse of Fourth Street Belt. This latter route runs eastbound from Grand and Arsenal, north on Grand to Lafayette, then on Lafayette, Mississippi, Park, St. Ange, Chouteau, 4th to Pine. Westbound route runs on Pine to 12th to Chouteau, 11th to Park, to 14th, Lafayette, Mississippi, Geyer, California, Gravois, Arsenal to Grand. </span></p></body></html>'),'2022-10-08T03:08:30.726Z');
INSERT INTO Comments VALUES(214,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">Bellefontaine</span><span style=" font-size:9pt;"> and </span><span style=" font-size:9pt; font-weight:600;">Tower Grove</span><span style=" font-size:9pt;"> lines re-routed northbound on Grattan, from Lafayette to Chouteau then east on Chouteau to 4th. </span></p></body></html>'),'2016-09-29 19:40:30');
INSERT INTO Comments VALUES(215,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed over new 12th Street cut-off to Chouteau. </span></p></body></html>'),'2016-09-29 19:41:03');
INSERT INTO Comments VALUES(216,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">During 1925 one-man operation on Sundays and holidays begins.</span></p></body></html>'),'2022-10-08T14:22:24.047Z');
INSERT INTO Comments VALUES(217,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">line numbered 13</span></p></body></html>'),'2016-09-29T19:43:15.640');
INSERT INTO Comments VALUES(218,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Temporarily disrupted until today owing to erection of a viaduct over the Wabash RR. However on resuming normal operation today, the line now operates to Bernays and Florissant only. The existing tracks beyond there are only used by the </span><span style=" font-size:9pt; font-weight:600;">Bellefontaine</span><span style=" font-size:9pt;"> line. </span></p></body></html>'),'2022-10-01T15:37:14.444Z');
INSERT INTO Comments VALUES(219,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed(extended??) from Union west on Berlin(Pershing) to DeBaliviere.</span></p></body></html>'),'2022-10-01T15:36:28.739Z');
INSERT INTO Comments VALUES(220,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">(Possibly August 5th) Line re-routed south on Union to Delmar, then west on Delmar, south on DeBaliviere to Pershing, east on Pershing to Union and north on Union. </span></p></body></html>'),'2022-10-02T20:47:22.283Z');
INSERT INTO Comments VALUES(221,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">line numbered 33</span></p></body></html>'),'2016-09-29 19:49:56');
INSERT INTO Comments VALUES(222,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">With new viaduct opening, cars re-routed to run on Vandeventer to Tower Grove. </span></p></body></html>'),'2016-09-29 19:50:36');
