INSERT INTO Comments VALUES(225,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed downtown to run on Morgan, Broadway and Franklin. </span></p></body></html>'),'2016-09-29 19:52:09');
INSERT INTO Comments VALUES(226,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">The 1903 City Directory gives this route description. </span></p>\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt;"><br /></p>\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt; font-weight:600;">Delmar and Clayton Line</span></p>\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt; font-weight:600;"><br /></p>\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Route: Starts and Ferguson and Creve Coeur Lake lline, to St Charles Rock Road, and returns to Creve Coeur Lake Line. Creve Coeur Lake Line to Hanley Road. Hanley Road to Hodiamont, Hodiamont to Hanley Road, Hanley road to Creve Coeur Lake line and Ferguson. </span></p></body></html>'),'2022-09-27T18:10:54.878Z');
INSERT INTO Comments VALUES(227,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line re-routed because of 82 Fourth Street closuree the previous day. Now runs from Compton &amp; Lafayette, via Lafayette, Grattan, Chouteu, 14th, Washington to 3rd.</span></p></body></html>'),'2016-12-08T21:01:34.848');
INSERT INTO Comments VALUES(228,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Line converted to one-man operation.</span></p></body></html>'),'2016-12-08 21:02:29');
INSERT INTO Comments VALUES(229,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Because of Market Street reconstruction, line re-routed to run from Magnolia via Thurman, Shenandoah, Compton, Lafayette, 12th, Washington to 3rd. Return via Washington, 12th, Lafayette, Nebraska, Shenandoah, Thurman to Magnolia. </span></p></body></html>'),'2016-12-08T21:10:03.852');
INSERT INTO Comments VALUES(230,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Last day. Replaced by re-routed car line and Tower Grove Bus. </span></p></body></html>'),'2016-12-08 21:10:51');
INSERT INTO Comments VALUES(231,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Last day. Replaced next day by Park-Southampton bus. </span></p></body></html>'),'2016-12-08 21:12:38');
INSERT INTO Comments VALUES(232,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-12-08T21:13:50.232');
INSERT INTO Comments VALUES(233,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Last day. </span></p></body></html>'),'2016-12-08 21:14:18');
INSERT INTO Comments VALUES(234,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-12-08T21:14:50.671');
INSERT INTO Comments VALUES(235,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">New line introduced over existing trackage to replace a portion of the Sarah line, diverted over the southern portion of the Vandeventer line which closed yesterday. From 39th &amp; Park, north on 39th, west on Chouteau to Manchester, west on Manchester to Sarah, south on Sarah to Vandeventer, east on Vandeventer to Chouteau, east on Chouteau to 39th, then south on 39th to Park.</span></p></body></html>'),'2016-12-08 21:18:35');
INSERT INTO Comments VALUES(236,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Last day. Tracks stay for access to and from 39th &amp; Park and Chouteau.</span></p></body></html>'),'2016-12-08 21:19:59');
INSERT INTO Comments VALUES(237,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style="-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><br /></p></body></html>'),'2016-12-08T22:06:46.247');
INSERT INTO Comments VALUES(238,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''MS Shell Dlg 2''; font-size:8.25pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Rerouting cause by abandonment of tracks on Gravois and picking up former Fourth Street line''s tracks on Lafayette.</span></p></body></html>'),'2016-12-09T03:58:11.412');
INSERT INTO Comments VALUES(239,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">California line terminates at Meramec &amp; Virginia and Grand line now runs over former California line to Michigan &amp; Primm. </span></p></body></html>'),'2016-12-13T20:00:17.697');
INSERT INTO Comments VALUES(240,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;"><span style=" font-size:9pt;">Grand line now runs over former California line from Meramec &amp; Virginia to Michigan &amp; Primm. </span></p></body></html>'),'2016-12-13 20:01:30');
INSERT INTO Comments VALUES(241,'',unistr('<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\u000a<html><head><meta name="qrichtext" content="1" /><style type="text/css">\u000ap, li { white-space: pre-wrap; }\u000a</style></head><body style=" font-family:''Ubuntu''; font-size:11pt; font-weight:400; font-style:normal;">\u000a<p style=" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;">Line  re-routed to loop downtown from 8th and Franklin via 8th, Walnut, 9th, Cass and regular route.</p></body></html>'),'2016-12-24T20:46:52.579');
